import React from 'react'
import {fetch as fetchPolyfill} from 'whatwg-fetch'


/**
 * 我们的基本的工具
 */

// parseJSON=function(response){
//     return response.json()
// }

export function FetchDoGet(url,callback,paramMapList){

    if(null!=paramMapList&&undefined!=paramMapList){
        paramMapList.forEach(element => {
            console.log("element",element);
        });
    }

    fetch(url,{
        method:"GET",
    }).then(function(response){
        return response.json()
    }).then(function(json){
        if(json.respCode==200){
            if(null!=callback&&undefined!=callback){
                callback(json.data)   
            }
        }else if(json.respCode==300){
            alert(json.data)
        }else{
            alert(json.data)
        }
       console.log(json)
    });
}
